import React, { Component } from "react";

export class PersonalDetails extends Component {
  constructor() {
    super();
    this.state = {
	  pName: "John Jones",
      pPhone: "01 2345 6789",
      plocation: "Sydney, Australia",
      pEmail: "john.jones@gmail.com",
    };
  }

  render() {
    return (
      <div>
        <form>
          <input
            type="text"
            id="pName"
            placeholder="Full Name"
            value={this.state.pNam}
          ></input>
          <input
            type="text"
            id="pNumber"
            placeholder="Phone Number"
            value={this.state.pNam}
          ></input>
          <input
            type="text"
            id="pLocation"
            placeholder="Location"
            value={this.state.location}
          ></input>
          <input
            type="text"
            id="pEmail"
            placeholder="Email"
            value={this.state.email}
          ></input>
        </form>
      </div>
    );
  }
}

export default PersonalDetails;
